def SmartSquare(inlist,inplace):
    list = inlist[:]
    if inplace == 1:
        for i in range(len(inlist)):
            inlist[i] = inlist[i]**2
            newlist = inlist
        return(inlist,newlist)
    else:
        inlist = list[:]
        otherlist = inlist[:]
        for i in range(len(otherlist)):
            otherlist[i] = otherlist[i]**2
        return(inlist,otherlist)
